#include<iostream>
#include<string>
#include<unordered_map>
#include<utility>

using namespace std;

void tomap(unordered_map<char, pair<int, int>>& m, char& c, int& idx) {
	m[c].first = idx;
	m[c].second++;
}

int uniqIdx(string& s) {

	char c;
	long min = 1e9;
	int atleast = 0;
	char f, b;
	unordered_map <char, pair<int, int>> umap;

	if (s.length() % 2 == 1) 
	{
		int idx = s.length() - 1;
		tomap(umap, s[idx],idx);
	}

	for (int i = 0; i < (s.length()/2); i++) 
	{	
		int j = ((s.length() / 2) * 2) - i - 1;
		f = s[i];
		b = s[j];
		tomap(umap, f, i);
		tomap(umap, b, j);
	}
	for (auto ele : umap) 
	{
		if (ele.second.second == 1) {
			atleast = 1;
			if (ele.second.first < min) {
				min = ele.second.first;
			}
		}
	}
	if (!atleast) return -1;

	return min + 1;
}

int main() {

	string s="";
	//string s = "";

	/*cout << "enter the string : " << endl;
	cin >> s;*/

	cout << uniqIdx(s);
}
